The invention concerns oxime derivatives of the formula I

 wherein R⁴ is hydrogen, (1-4C)alkyl, halogeno-(2-4C)alkyl, hydroxy-(2-4C)alkyl, cyano-(1-4C)alkyl, phenyl or phenyl-(1-4C)alkyl; 
R⁵ is hydrogen, (1-4C)alkyl, halogeno-(2-4C)alkyl, hydroxy-(2-4C)alkyl, cyano-(1-4C)alkyl, phenyl or phenyl-(1-4C)alkyl, or a heteroaryl moiety selected from pyridyl, pyrimidinyl, pyrazinyl, pyridazinyl, furyl, thienyl, oxazolyl and thiazolyl; 
A⁴ is (1-4C)alkylene; 
Ar¹ is phenylene, pyridinediyl or pyrimidinediyl; 
A¹ is a direct link to X¹, or A¹ is (1-4C)alkylene; 
X¹ is oxy, thio, sulphinyl or sulphonyl; 
Ar² is phenylene, pyridinediyl, pyrimidinediyl, thiophenediyl, furandiyl or thiazolediyl; 
R¹ is hydrogen, (1-4C)alkyl, (3-4C)alkenyl or (3-4C)alkynyl; and 
R² and R³ together form a group of the formula -A²-X²-A³- wherein each of A² and A³ is independently (1-3C)alkylene and X² is oxy, thio, sulphinyl, sulphonyl or imino; 
or a pharmaceutically-acceptable salt thereof; 
processes for their manufacture; pharmaceutical compositions containing them and their use as 5-lipoxygenase inhibitors.

The invention concerns hydroxylamine derivatives of the formula I

 wherein R⁴ is hydrogen, carbamoyl, (1-4C)alkyl, cyclopentyl, cyclohexyl, tetrahydrofuran-3-yl, tetrahydropyran-4-yl, piperidin-4-yl,  N -(1-4C)alkylpiperidin-4-yl, (2-5C)alkanoyl, (1-4C)alkylsulphonyl,  N -(1-4C)alkylcarbamoyl,  N , N -di-(1-4C)alkylcarbamoyl, phenyl, phenyl-(1-4C)alkyl, di-phenyl-(1-4C)alkyl, benzoyl, phenylsulphonyl or a heteroarylmethyl group; 
R⁵ is hydrogen, (1-4C)alkyl, (3-4C)alkenyl, (3-4C)alkynyl, cyano-(1-4C)alkyl, phenyl or phenyl-(1-4C)alkyl; 
A⁴ is (1-4C)alkylene; 
Ar¹ is phenylene, pyridinediyl or pyrimidinediyl; 
A¹ is a direct link to X¹, or A¹ is (1-4C)alkylene; 
X¹ is oxy, thio, sulphinyl or sulphonyl; 
Ar² is phenylene, pyridinediyl, pyrimidinediyl, thiophenediyl, furandiyl or thiazolediyl; 
R¹ is hydrogen, (1-4C)alkyl, (3-4C)alkenyl or (3-4C)alkynyl; and 
R² and R³ together form a group of the formula -A²-X²-A³- wherein each of A² and A³ is independently (1-3C)alkylene and X² is oxy, thio, sulphinyl, sulphonyl or imino; 
or a pharmaceutically-acceptable salt thereof; 
processes for their manufacture; pharmaceutical compositions containing them and their use as 5-lipoxygenase inhibitors.

Naphtho[2,1-b]furan derivatives of the formula:-
   wherein 
R¹ is a 1 H -1,2,4-triazol-1-yl, 4 H -1,2,4-triazol-4-yl, 3-pyridyl or 5-pyrimidinyl radical or a 1 H -imidazol-1-yl radical optionally substituted in the 5-position by a 1-6C alkyl or halogenoalkyl radical; 
R² and R³, which may be the same or different, are each a hydrogen or deuterium atom, a cyano radical, a 1-6C alkyl or halogenoalkyl radical, a phenyl radical optionally substituted by halogen, or one of R² and R³ is a radical of the formula R¹ as defined above, and the other is hydrogen; 
R⁴ and R⁵, which may be the same or different, are each a 1-2C alkyl, deuterioalkyl or halogenoalkyl radical; 
or R⁴ and R⁵ together with the carbon atom to which they are attached form a 3-6C cycloalkyl radical; 
R⁶ and R⁷, which may be the same or different, are each a hydrogen or halogen atom, an amino, carboxy, carbamoyl, cyano, 1-­cyano-1-methylethyl or nitro radical, a 1-6C alkyl or halogenoalkyl radical, a mono- or di-(1-6C)alkylcarbamoyl radical, a mono- or di-(1-6C)halogenoalkylcarbamoyl radical, a group of the formula -COR⁸, -SO n R⁸ or -OR⁸, in which n is 0, 1 or 2 and R⁸ is a 1-6C alkyl or halogenoalkyl radical, or a benzoyl radical optionally substituted by halogen; 
one of R⁹ and R¹⁰ is hydrogen and the other is a hydroxy or 1-6C alkoxy radical, or R⁹ and R¹⁰ together form an oxo radical; and the pharmaceutically acceptable acid addition salts thereof; 
processes for their manufacture; and pharmaceutical compositions containing them.
